import Head from "next/head";
import React, { Component } from "react";
import Header from "../components/Header";
import QuickSetting from "../components/QuickSetting";
import SidebarMenu from "../components/SidebarMenu";
import Footer from "../components/Footer";
import ContentStaff from '../components/ContainerComponents/staff/ContentStaff'
import {setcookie,getCookie,checkCookie} from '../Cookies/Cookies'
import { Router } from "next/router";




export class Index extends Component {
  static async getInitialProps(ctx) {
    let res_departments = await Send_Get_RestAPI("http://localhost:3001/score/departments");
    let results_departments = await res_departments.json();
    let res_brenches = await Send_Get_RestAPI("http://localhost:3001/score/brenches");
    let results_brenches = await res_brenches.json();
    let res_classes = await Send_Get_RestAPI("http://localhost:3001/score/classes");
    let results_classes = await res_classes.json();
    let res_subjects = await Send_Get_RestAPI("http://localhost:3001/score/subjects");
    let results_subjects = await res_subjects.json();
    let res_students = await Send_Get_RestAPI("http://localhost:3001/score/students");
    let results_students = await res_students.json();
    let res_typescores =  await Send_Get_RestAPI("http://localhost:3001/score/typescores");
    let results_typescores = await res_typescores.json();
return {results_departments : results_departments,results_brenches: results_brenches ,results_classes: results_classes,
  results_subjects :results_subjects,results_students :results_students,results_typescores:results_typescores, header: 'List Staff',name:"thanh"};
 }
  constructor(props) {
    super(props);
    this.props.children
    this.state = {
      counters: "this is thanh",
      name: "thanh",
      students: this.props.results
    };
  }
  render() {
    console.log(this.props.children);
    return (
      <div>
        <Head>
          <meta charSet="utf-8" />
          <meta httpEquiv="X-UA-Compatible" content="IE=edge" />
          <meta content="width=device-width, initial-scale=1" name="viewport" />
          <meta name="description" content="Responsive Admin Template" />
          <meta name="author" content="SmartUniversity" />
          <title>CDKTDL</title>
          {/* google font */}
          <link
            href="https://fonts.googleapis.com/css?family=Poppins:300,400,500,600,700"
            rel="stylesheet"
            type="text/css"
          />
          {/* icons */}
          <link
            href="../fonts/simple-line-icons/simple-line-icons.min.css"
            rel="stylesheet"
            type="text/css"
          />
          <link
            href="../fonts/font-awesome/css/font-awesome.min.css"
            rel="stylesheet"
            type="text/css"
          />
          <link
            href="../fonts/material-design-icons/material-icon.css"
            rel="stylesheet"
            type="text/css"
          />
          	<link href="../assets/plugins/datatables/plugins/bootstrap/dataTables.bootstrap4.min.css" rel="stylesheet"/>
          {/*bootstrap */}
          <link
            href="../assets/plugins/bootstrap/css/bootstrap.min.css"
            rel="stylesheet"
            type="text/css"
          />
          	<link href="../assets/plugins/summernote/summernote.css" rel="stylesheet"></link>
          {/*inbox style */}
          <link href="../assets/css/pages/inbox.min.css" rel="stylesheet" type="text/css" />
          {/* Material Design Lite CSS */}
          <link
            rel="stylesheet"
            href="../assets/plugins/material/material.min.css"
          />
          <link rel="stylesheet" href="../assets/css/material_style.css" />
          {/* Theme Styles */}
          <link
            href="../assets/css/theme/light/theme_style.css"
            rel="stylesheet"
            id="rt_style_components"
            type="text/css"
          />
          <link
            href="../assets/css/theme/light/style.css"
            rel="stylesheet"
            type="text/css"
          />
          <link
            href="../assets/css/plugins.min.css"
            rel="stylesheet"
            type="text/css"
          />
          <link
            href="../assets/css/responsive.css"
            rel="stylesheet"
            type="text/css"
          />
          <link
            href="../assets/css/theme/light/theme-color.css"
            rel="stylesheet"
            type="text/css"
          />
          {/* dropzone */}
          <link
            href="../assets/plugins/dropzone/dropzone.css"
            rel="stylesheet"
            media="screen"
          />
          {/* Date Time item CSS */}
          <link
            rel="stylesheet"
            href="../assets/plugins/flatpicker/css/flatpickr.min.css"
          />
          {/* favicon */}
          <link rel="shortcut icon" href="../assets/img/favicon.ico" />
        </Head>
        <div className="page-wrapper">
          <Header />
          <QuickSetting />
          <div className="page-container">
            <SidebarMenu />
           {this.props.children}
          </div>
          <Footer />
        </div>
        <script src="../assets/plugins/jquery/jquery.min.js"></script>
        <script src="../assets/plugins/popper/popper.js"></script>
        <script src="../assets/plugins/jquery-blockui/jquery.blockui.min.js"></script>
        <script src="../assets/plugins/jquery-slimscroll/jquery.slimscroll.js"></script>

        <script src="../assets/plugins/bootstrap/js/bootstrap.min.js"></script>
        <script src="../assets/plugins/bootstrap-switch/js/bootstrap-switch.min.js"></script>

        <script src="../assets/plugins/datatables/jquery.dataTables.min.js"></script>
        <script src="../assets/plugins/datatables/plugins/bootstrap/dataTables.bootstrap4.min.js"></script>
        <script src="../assets/js/pages/table/table_data.js"></script>

        <script src="../assets/js/app.js"></script>
        <script src="../assets/js/layout.js"></script>
        <script src="../assets/js/theme-color.js"></script>

        <script src="../assets/plugins/material/material.min.js"></script>
        <script src="../assets/js/pages/material-select/getmdl-select.js"></script>
        <script src="../assets/plugins/flatpicker/js/flatpicker.min.js"></script>
        <script src="../assets/js/pages/date-time/date-time.init.js"></script>

        <script src="../assets/plugins/dropzone/dropzone.js"></script>
        <script src="../assets/plugins/dropzone/dropzone-call.js"></script>

        <script src="../assets/plugins/apexcharts/apexcharts.min.js"></script>
        <script src="../assets/js/pages/chart/chartjs/home-data.js"></script>


      </div>
    );
  }
}

export default Index;
